import React, {Component} from 'react';
import Developer from './components/developer';
import './App.css';

const customer = {
  'id':1,
  'image': 'https://www.google.co.kr/imgres?imgurl=https%3A%2F%2Fwww.consignor.com%2Fwp-content%2Fuploads%2F2019%2F06%2FSenior-Front-End-Developer-1080x675.jpg&imgrefurl=https%3A%2F%2Fwww.consignor.com%2Fsenior-front-end-web-developer%2F&tbnid=ulA3iNxhIf1xRM&vet=12ahUKEwi7ttT0psfoAhUIUJQKHVleBpIQMygAegUIARDsAQ..i&docid=MiUJslQ3wlKs8M&w=1080&h=675&q=developer&ved=2ahUKEwi7ttT0psfoAhUIUJQKHVleBpIQMygAegUIARDsAQ',
  'name':'하늘',
  'birthday':'920927',
  'gender':'남자',
  'job':'대학원생'
}

class App extends Component {
  render() {
    return (
      <Developer
        name={customer.name}
        birthday={customer.birthday}
        gender={customer.gender}
        job={customer.job}
      />
    );
  }
}


export default App;
